import React from 'react';
import 'onsenui/css/onsenui.css';
import 'onsenui/css/onsen-css-components.css';
import TabBar from './Element/TabBar';

var Ons = require('onsenui');
var ROns = require('react-onsenui');

class Base extends React.Component {

    renderToolbar(route, navigator) {
      const backButton = route.hasBackButton
        ? <ROns.BackButton onClick={this.handleClick.bind(this, navigator)}>Back</ROns.BackButton>
        : null;
  
      return (
        <ROns.Toolbar>
          <div className='left'>{backButton}</div>
          <div className='center'>{route.title}</div>
        </ROns.Toolbar>
      );
    }

    handleClick (navigator) {
      ons.notification.confirm('Do you really want to go back?')
        .then((response) => {
          if (response === 1) {
            navigator.popPage();
          }
        });
    }

    renderPage(route, navigator) {
      const props = route.props || {};
      props.navigator = navigator;
  
      return React.createElement(route.component, props);
    }
      
    render() {
      return (
        <ROns.Navigator
        initialRoute={{component: TabBar, props: {key: 'main'}}}
        renderPage={this.renderPage}/>);
    }
}


export default Base;
